import React from 'react';
import {FaBars, FaTimes} from 'react-icons/fa';

const NavBar = () => {
  return (
    <div className="flex justify-between items-center w-full h-20 px-4 text-emerald-400 bg-black fixed">
    <div>
        <h1 className='text-5xl font-myFont ml-2'>Williams</h1>
        </div>
      <ul className='flex'>
        <li className='px-4 cursor-pointer hover:scale-100'>HOME</li>
        <li className='px-4 cursor-pointer hover:scale-100'>ABOUT</li>
      </ul>
     </div>
  );
};

export default NavBar;
